import React from 'react';

const MyComponent = () => {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container">
                <i className=" huge youtube icon"/>
            </div>
        </nav>
    );
};

export default MyComponent;
